"use client";

import { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";
import { Button } from "../components/ui/button";
import { Input } from "../components/ui/input";
import { Label } from "../components/ui/label";
import {
  Card,
  CardContent,
  CardDescription,
  CardFooter,
  CardHeader,
  CardTitle,
} from "../components/ui/card";
import { useToast } from "../components/ui/use-toast";
import { typeText, glitchAnimation } from "../lib/animations";
import anime from "animejs";

export default function LoginPage() {
  const navigate = useNavigate();
  const { login } = useAuth();
  const { toast } = useToast();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [isLoading, setIsLoading] = useState(false);

  useEffect(() => {
    // Apply typing effect to title
    typeText(".login-title", null, 800);

    // Apply glitch animation to the card
    const loginCard = document.querySelector(".login-card");
    if (loginCard) {
      anime({
        targets: loginCard,
        boxShadow: [
          "0 0 5px rgba(0, 246, 255, 0.5), 0 0 15px rgba(0, 246, 255, 0.3)",
          "0 0 2px rgba(0, 246, 255, 0.5), 0 0 10px rgba(0, 246, 255, 0.3)",
          "0 0 5px rgba(0, 246, 255, 0.5), 0 0 15px rgba(0, 246, 255, 0.3)",
        ],
        duration: 2000,
        direction: "alternate",
        loop: true,
        easing: "easeInOutSine",
      });
    }
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);

    try {
      await login({ email, password });
      toast({
        title: "Login successful",
        description: "You have been logged in successfully",
      });
      navigate("/");
    } catch (error) {
      toast({
        title: "Login failed",
        description: error.message || "Invalid credentials",
        variant: "destructive",
      });
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="container flex items-center justify-center min-h-[80vh] py-8 bg-cyber-gradient">
      <div className="absolute inset-0 bg-cyber-grid bg-[length:50px_50px] opacity-10 pointer-events-none"></div>
      <Card className="w-full max-w-md cyberpunk-card login-card border-cyberpunk-secondary/50">
        <CardHeader className="space-y-1">
          <CardTitle className="text-2xl font-bold font-cyber neon-text login-title">
            Access Terminal
          </CardTitle>
          <CardDescription className="font-mono-cyber">
            Enter credentials to authenticate
          </CardDescription>
        </CardHeader>
        <form onSubmit={handleSubmit}>
          <CardContent className="space-y-4">
            <div className="space-y-2">
              <Label
                htmlFor="email"
                className="font-cyber text-cyberpunk-secondary"
              >
                User ID
              </Label>
              <Input
                id="email"
                type="email"
                placeholder="your.email@example.com"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
                className="cyber-console border-cyberpunk-secondary focus:border-cyberpunk-secondary focus:ring-cyberpunk-secondary"
              />
            </div>
            <div className="space-y-2">
              <div className="flex items-center justify-between">
                <Label
                  htmlFor="password"
                  className="font-cyber text-cyberpunk-secondary"
                >
                  Security Key
                </Label>
                <Link
                  to="/forgot-password"
                  className="text-xs text-cyberpunk-secondary hover:text-cyberpunk-secondary hover:neon-text font-mono-cyber"
                >
                  Reset Key
                </Link>
              </div>
              <Input
                id="password"
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
                className="cyber-console border-cyberpunk-secondary focus:border-cyberpunk-secondary focus:ring-cyberpunk-secondary"
              />
            </div>
          </CardContent>
          <CardFooter className="flex flex-col">
            <Button
              type="submit"
              className="w-full btn-cyber"
              disabled={isLoading}
            >
              {isLoading ? "Authenticating..." : "Authenticate"}
            </Button>
            <p className="mt-4 text-center text-sm text-muted-foreground font-mono-cyber">
              No access credentials?{" "}
              <Link
                to="/register"
                className="text-cyberpunk-primary neon-text-pink hover:underline"
              >
                Register New Identity
              </Link>
            </p>
          </CardFooter>
        </form>
      </Card>
    </div>
  );
}
